import React, { useState } from "react";

function FetchApi() {

    const [data, setData] = useState([]);


const apiGet = () => {
    fetch('https://jsonplaceholder.typicode.com/posts/1')
    .then(response => response.json())
    .then(json => {
        console.log(json);
        setData(json);
    });
};

    return (

    <div>
        My Api <br />
        <button onClick={apiGet}>Fetch API</button> <br />
        {JSON.stringify(data)}
    </div>

    );
}

export default FetchApi;
